import React from 'react';
import './Navbar.css'
import logo from '../Assets/ss.png';
import cart from '../Assets/cart.png';
import { Link } from 'react-router-dom';

 const Navbar = () => {

    return (
        <div className='navbar'>
            <div className="nav-logo">
                <img src={logo} alt="" />
                <p>Home Made</p>
            </div>
            <ul className="nav-menu">
                <li> <a to='/'>Home</a><hr/></li>
                <li> <a to='/recipes'>Recipes</a> <hr/></li>
                <li> <a to='/td'>TD</a><hr/></li>
            </ul>
            <div className="nav-login-cart">
                <a to='/login'><button>Login</button></a>
                <a to='/cart'><img src={cart} alt="" /></a>
                <div className="nav-cart-acount">0</div>

            </div>
        </div>
    );
};

export default Navbar
